INSERT INTO `tbl_en` VALUES ('mod_iamod_help_helpitem', 'This module evaluates the navigational component of the Information Architecture of KEWL.NextGen by displaying most frequently traversed navigational paths for users<p>1.Select a target module</p><p>2.Select a date range:A start date and an end date later than the start date</p><p>4.Select a category of users</p><p>5.Select the minimum threshold value which represents a percentage of the total amount of users paths in a search</p><p>6.Then select the ''View'' button to view results</p><p>*n = number of users *p = number of times path traversed</p>\n', 'iamod', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
