INSERT INTO `tbl_en` VALUES ('help_guitar_overview_chordfinder', 'Use the chord finder to look up chord patterns. Each chord pattern is displayed as an overlay on a virtual guitar neck, in addition to which a photograph is shown of a left hand playing the chord. Key signatures are also shown where appropriate (for major and minor chords). Click a chord to view it.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_guitar_title_tuner', 'Guitar tuner\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_guitar_overview_tuner', 'Click any string on the guitar, and it will sound three times. Use the sounds to bring your own guitar into tune with the sound made. If you are not finished after the third sound, click the string again, and as many times as you need to in order to tune your string.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
