INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_A', '<i>A major</i> is a major scale based on A, consisting of the pitches A, B, C#, D, E, F#, G#, and A. Its key signature consists of three sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_B', '<i>B major</i> is a major scale based on B, consisting of the pitches B, C#, D#, E, F#, G#, A#, and B. Its key signature consists of five sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Bb', '<i>B-flat major</i> is a major scale based on B-flat, consisting of the pitches B-flat, C, D, E-flat, F, G, A, and B-flat. Its key signature consists of two flats.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_C', '<i>C major</i> (often just C) is a major scale based on C, consisting of the pitches C, D, E, F, G, A, B and C. Its key signature consists of no flats and no sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_D', '<i>D major</i> is a major scale based on D, consisting of the pitches D, E, F#, G, A, B, C# and D. Its key signature consists of two sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_E', '<i>E major</i> is a major scale based on E, consisting of the pitches E, F#, G#, A, B, C#, D# and E. Its key signature consists of four sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_F', '<i>F major</i> is a major scale based on F, consisting of the pitches F, G, A, B-flat, C, D, E, and F. Its key signature consists of one flat.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_G', '<i>G major</i> is a major scale based on G, consisting of the pitches G, A, B, C, D, E, F# and G. Its key signature consists of one sharp.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Am', '<i>A minor</i> (abbreviated Am) is a minor scale based on A, consisting of the pitches A, B, C, D, E, F, G-sharp, and A (harmonic minor scale). Its key signature consists no flats and no sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Bm', '<i>B minor</i> is a minor scale based on B, consisting of the pitches B, C-sharp, D, E, F-sharp, G, A-sharp (harmonic minor) or A (natural minor) and B. Its key signature consists of two sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Cm', '<i>C minor</i> (abreviated Cm) is a minor scale based on C, consisting of the pitches C, D, E-flat, F, G, A-flat, B and C (harmonic minor scale). Its key signature consists of three flats.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Dm', '<i>D minor</i> is a minor scale based on D, consisting of the pitches D, E, F, G, A, B-flat, C-sharp, and D (harmonic minor scale). Its key signature consists of one flat.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Em', '<i>E minor</i> is a minor scale based on E, consisting of the pitches E, F-sharp, G, A, B, C, D-sharp and E (harmonic minor scale). Its key signature consists of one sharps.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Fm', '<i>F minor</i> is a minor scale based on F, consisting of the pitches F, G, A-flat, B-flat, C, D-flat, E and F (harmonic minor scale). Its key signature consists of four flats.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_Gm', '<i>G minor</i> is a minor scale based on G, consisting of the pitches G, A, B-flat, C, D, E-flat, F-sharp, and G (harmonic minor scale). Its key signature consists of two flats.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_A7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence A7 is the A triad (A, C#, E) plus a G note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_B7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence B7 is the B triad (B, D#, E) plus a F# note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_C7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence C7 is the C triad (C, E, G) plus a Bb note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_D7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence D7 is the D triad (D, A, F#) plus a C note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_E7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence E7 is the E triad (E, G#, B) plus a D note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_F7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence F7 is the F triad (F, A, C) plus a D# note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_chord_G7', 'A seventh chord is a chord consisting of a triad plus a note forming an interval of a seventh above the chord''s root. Hence G7 is the G triad (G, B, D) plus a F note (the 7th).\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_guitar_overview', 'From Wikipedia, the free encyclopedia.<br /><br />A guitar is a stringed musical instrument. It is often played with the fingers of the left hand. The right hand plucks the strings with either the fingers or a plectrum (guitar pick). The sound is produced by vibrating strings, which in turn resonate the body and neck.<br /><br />Guitars may be acoustic, electric (i.e. with electrical amplification) or both. Classical guitars are also present in the guitar family, although they are not as popular as the prior two. Guitars have a body acting mostly as a resonator, which can be hollow in acoustic guitars or solid in most electric guitars, and a neck. Typically, a headstock extends from the neck for tuning. Guitars are made and repaired by luthiers.<br /><br />Guitars are used in a variety of musical styles. Guitars are widely known as a solo classical instrument, and the primary instrument in blues and rock music.<br /><br />The guitar module has been created as a resource for beginning guitar players. It provides some simple tools to help learn the guitar.\n', 'guitar', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
