INSERT INTO `tbl_en` VALUES ('help_scorm_about_title', 'About Scorm\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_scorm_about', 'The Sharable Content Object Reference Model (SCORM) aims to foster creation of reusable learning content as instructional objects within a common technical framework for computer and Web-based learning. SCORM describes that technical framework by providing a harmonized set of guidelines, specification and standards.\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_scorm_paraIntro', 'The Sharable Content Object Reference Model (SCORM) aims to foster creation of reusable learning content as instructional objects within a common technical framework for computer and Web-based learning. SCORM describes that technical framework by providing a harmonized set of guidelines, specification and standards.\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_scorm_paraSetting', 'SCORM helps define the technical foundations of a Web-based learning environment. At its simplest, it is a model that reference a set of interrelated technical specifications and guidelines designed to meet high-level requirements for learning content and systems. SCORM describes a "Content Aggregation Model (CAM)" and "Run-Time Environment (RTE)" for learning objects to support adaptive presentation of content based on criteria such as learner objectives, preferences and performance.\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_scorm_paraAim', 'The development of SCORM continues, even as the main medium it targets, the Web, continues to evolve and change. SCORM currently provides an Application Programming Interface (API) for communicating information about a learnern interaction with content objects, a defined data model for representing this information, a content packaging specification that enables interoperability of learning content, a standard set of meta-data elements that can be used to describing learning content and a set of standard sequencing rules which can be applied to the organization of the learning content. While the technical standards used by the Web turn out to work equally well locally, regionally and globally, when it comes to the standardization of e-learning itself, the task of SCORM, is continuing to evolve.\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_scorm_paraADL', 'This is one in a few  Technologies to be developed as part of.\n', 'scorm', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
