INSERT INTO `tbl_en` VALUES ('help_essay_overview_view', 'The essays in a topic can be viewed by clicking on the name of the topic or the view essays icon. To book an essay, click on the name of the essay or the book essay icon on the right. The message ''Booked by'' followed by your name will appear next to the name of the essay. If the name of the essay is not clickable then it has been booked by another [-readonly-]. The essay may be unbooked in the same manner. To view the [-authors-] notes on the essay click the notes icon on the right.\n', 'essay', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
