INSERT INTO `tbl_en` VALUES ('help_essay_overview_viewessays', 'The list of booked essays are displayed with links to upload or download the essay.<ul><li>Submit the essay by clicking on the submit icon.</li><li>Download a marked essay by clicking on the download icon and saving to disk.</li><li>View the [-authors-] comment on an essay by clicking on the comment icon next to the mark.</li></ul>\n', 'essay', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
