INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_about', '<p>Currently a worksheet is a relatively simple assignment that can be completed online and can only accept textual answers. A [-context-] can have a number of worksheets, but you may only create one worksheet per chapter within the [-context-].</p><p><ul><li>To create an online worksheet click the add icon next to the heading or at the bottom of the page.</li><li>To view the details and questions of a worksheet click on the name of the worksheet. </li><li>To edit, delete or mark a worksheet, click on the appropriate icon in the last column of the table. A worksheet can be edited at any time but only deleted before it is made viewable by [-readonlys-] or after it has been marked. </li><li>Similarly the worksheets answered and submitted by [-readonlys-] can only be marked once the closing date is past and the worksheet is closed to further submissions. </li><li>The status of a worksheet, whether it is inactive, open, closed, or marked and viewable is shown in the column ''Activity Status''. The [-author-] determines when the worksheet is open or marked. The closure of a worksheet can also be set but will happen automatically on the closing date.</li></ul></p>\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_about_title', 'About Online Worksheets Administration\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_title_add', 'Creating a Worksheet\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_overview_add', '<p><ol><li>Select a chapter number. This option will assign the worksheet to a particular chapter in the [-context-]. Please note that you can only create one worksheet per chapter. </li><li>Enter the worksheet name. </li><li>The worksheet is automatically set to ''not active'' on a new worksheet. The options for the activity status are as follows <ul><li>Not Active = Worksheet cannot be accessed by [-readonlys-]; </li><li>Open for Entry = Worksheet can be accessed and worked on by learners; </li><li>Closed for Marking = Worksheet can be viewed but not changed by learners; </li><li>Marked and viewable = Worksheet can be viewed with comments and marks but cannot be changed by [-readonlys-].</li></ul> </li><li>Enter the percentage that the worksheet will contribute to the final mark. </li><li>Enter a closing date so learners can know the date by which the worksheet must be completed. </li><li>Provide a description of the worksheet. This step is optional.</li></ol> Click ''Save'' to finish.\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_title_view', 'Viewing a worksheet\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_overview_view', '<p>Viewing a worksheet is where the details of the worksheet are displayed and the questions are managed. Options for editing, deleting or marking the worksheet are available in the page heading. The activity status of the worksheet is updated by editing the worksheet.</p><p>Managing the questions in a worksheet. <ol><li>Questions can be added by clicking on the add icon next to the questions heading. </li><li>Questions can be edited or deleted by clicking on the appropriate icon on the right. </li><li>The order in which the questions appear to the [-readonlys-] can be adjusted by clicking the up or down arrow on the right hand side.</li></ol></p>\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_title_addquestion', 'Adding a question to a worksheet\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_overview_addquestion', '<p>Up to two questions can be added at a time. The total mark for the worksheet is displayed under the heading. Fill in the form for each question as follows <ol><li>Enter the question.</li><li>Optional. Enter the answer to the question that can be used for marking the question.</li><li>Enter the mark for the question.</li><li>Optional. Use the browse button to locate the image.</li></ol>Once the question is complete click ''Save'' to save and return to the view worksheet page. Click ''Save and add another'' to continue adding questions. Click ''Exit'' to return to the view worksheet page without saving.</p>\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_title_markworksheet', 'Marking a worksheet\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheetadmin_overview_markworksheet', '<p>To mark a worksheet click the mark icon, the icon is displayed if the status of the worksheet has been set to ''closed for marking''. A page displaying a list of [-readonlys-] who have submitted worksheets, those worksheets that have been marked will display the mark. Click on the link on the right to open the worksheet for marking.</p><p>The worksheet is marked one question at a time, each question displays the [-readonlys-] name and number. <ol><li>The model answer is displayed beneath the question with the [-readonlys-] answer below it. </li><li>Enter a comment on the answer.</li><li>Enter the mark for the answer.</li><li>Use the navigation at the bottom of the page to progress through worksheet.<ul><li>''Prev'' opens to the previous question. </li><li>''Next'' opens the next question for marking. </li><li>''First question'' displays the first question in the worksheet and </li><li>''Last marked question'' displays the last question to be marked.</li></ul></li></ol>Click ''Save'' to save a partially marked worksheet. Click ''Exit'' to return to the main page without saving the current mark. Once marking is complete a ''Submit'' button becomes available. Click ''Submit'' to submit the marked worksheet.\n', 'worksheetadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
