INSERT INTO `tbl_en` VALUES ('help_wiki_overview_add', '<p>This is the form you use to add a new wiki page to the database.</p><ol><li><p>Click the add icon or link on the Wiki Page List template.</p></li><li><p>Type the name of the page in the textinput area labelled ''Wiki Page Name''.</p></li><p><li>Select the page status. Select "Public" if you want the page to be veiwed by all users, "Private" if you want to create a private page which can only be viewed by you or "Context Related" if you want the page to be viewed by all members currently inside the selected context. <b>NB. Student and guests can only create private wiki pages.</b></p></li><li><p>Select a context to associate your page with from the dropdown list of all available contexts. This will make it easier to find relative material and is needed to associate context related material.</p></li><li><p>Insert the content to be displayed on the page in the textarea directly below this.</p></li><li>This content must however be inserted using the wiki text formatting rules. These rules can be obtained from the extended help feature of this document by clicking the small screen icon at the bottom left of this window.</p></li></ol>\n', 'wiki', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_wiki_title_edit', 'Editing A Wiki Page\n', 'wiki', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_wiki_overview_edit', '<p>This is the form you would use to edit an existing wiki page</p><ol><li><p>Click the edit icon or link associated with the wiki page you wish to edit.</p></li><li><p>Now simply change the current status, context(Creator only) and add your input to the existing text in the textarea or make appropriate alterations, give a brief description of what you did in the text field labelled "Edit Description" and press the save button when you are complete.</p></li><li><p>The additions or alterations must however be done using the wiki text formatting rules. These rules can be obtained from the extended help feature of this document by clicking the small screen icon at the bottom left of this window.</p></li></ol>\n', 'wiki', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
