INSERT INTO `tbl_en` VALUES ('help_essayadmin_about_title', 'About Essay Management\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_about', 'Essay Management is for managing essays. Functionality is provided for creating an essay topic by clicking on the add icon. Essays can then be added to the topic by clicking on the topic name or the view essays icon. Essays that have been booked and uploaded by [-readonlys-] can be downloaded and marked by entering the mark essays section.\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_title_addtopic', 'Create an essay topic\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_overview_addtopic', 'An essay topic describes the area of study on which the essays will be based. Fill in the create essay topic form as follows<p><ol><li>Enter the topic area.</li><li>Enter a description of the topic.<ul><li>Enter instructions on how to complete the essay.</li><li>Select the final date for submission of the essay by clicking on the calendar icon and selecting a date.</li><li>Select bypass closing date if the date of submission is not important.</li><li>Select force on [-readonly-] per essay if each student must book a different essay.</li><li>Enter the percentage that the essay counts towards the final year mark.</li></ol></p><p>Click save to save the topic, click reset to delete anything added since the last save and exit to return to the main page without saving.</p>\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_title_view', 'View an essay topic\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_overview_view', 'The essay topic can be viewed by clicking on the topic name or the view essays icon on the main page. The essay topic is displayed with the list of essays in the topic. The essays are managed from this page.\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_title_addessay', 'Create an essay\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_overview_addessay', '<p>Create an essay by clicking on the add icon on the view topic or view essays page. This displays a form<ol><li>Enter the name or topic of the essay.</li><li>Enter some notes on or a description of the essay.</li></ol></p><p>Click save to save the essay, click reset to delete anything added since the last save and exit to return to the main page without saving.</p>\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_title_marktopic', 'View [-readonlys-] who have booked essays\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_overview_marktopic', 'Click on the mark essays icon on the main page or the view booked / submitted essays link on the view topic page. A list of [-readonlys-] who have booked essays is displayed.<ul><li>Once a [-readonly-] has submitted an essay it can be downloaded by clicking on the download icon. </li><li>A [-readonly-]''s mark can be entered by clicking on the submit icon.</li></ul>\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_title_upload', 'Marking an essay\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_essayadmin_overview_upload', '<ul><li>Enter the mark for the essay as a percentage. </li><li>Enter a comment on the essay. </li><li>The marked essay can be uploaded by using the browse button to find the essay and clicking upload.</li></ul>Click save to save the mark and comment. Click exit to return to the list of [-readonlys-].\n', 'essayadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
