INSERT INTO `tbl_en` VALUES ('mod_applicationforms_confirmapplicationemail', '<p>Dear [-title-] [-appname-]</p><p>Thank you for your interest in the Training Course on Bioinformatics and Functional Genomics Applied to Tsetse Fly - Vector of Human African Trypanosomiasis, presented by SANBI and funded by the UNICEF/UNDP/World Bank/WHO Special Programme for Research and Training in Tropical Diseases and the South African Medical Research Council.</p><p>Your application has been received successfully and will be evaluated. Selected participants will be notified on 10 May 2006.  Please confirm that the data you''ve submitted is correct (see below).  For enquiries or corrections contact me at anelda@sanbi.ac.za or +27 21 959-2998.</p><p>Regards,<br>Anelda</p><p>--<br>Glossina WHO/TDR Course Coordinator<br>Phone&#58; +27 (0)21 959-2998<br>SANBI, UWC<br>Fax&#58; +27 (0)21 959-2512<br>South Africa<br>Email&#58; anelda@sanbi.ac.za<br>Skype&#58; anelda</p>\n', 'applicationforms', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
