INSERT INTO `tbl_en` VALUES ('help_assignment_about', 'Assignments provides access to Essays, Online Worksheets and MCQ Tests. New assignments, worksheets and tests are listed with their closing dates and status. Booked essays are displayed along with a message if a new topic is set. <p>The status can be the following<ol><li>Open - The assignment is open for entry.</li><li>Closed - The closing date has passed and the assignment is no longer available.</li><li>Submitted - The assignment has been submitted for marking.</li><li>Marked - in this case the mark is displayed along with the lecturers comment.</li></ol>\n', 'assignment', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
