INSERT INTO `tbl_en` VALUES ('mod_trackback_pingexurl', 'Enter the complete URL to which you wish to send a ping. Make sure that it is entered exactly as it is provided by the trackback feature of the site that you wish to ping. You send a trackback ping to an external site when you wish to let the site owner know that you have made reference to a trackable item such as a weblog or discussion post.\n', 'trackback', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_trackback_pingexttit', 'Send a trackback ping to an external site\n', 'trackback', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_trackback_about', 'TrackBack is a method of notification between websites. It is a method of person A saying to person B, This is something you may be interested in. To do that, person A sends a TrackBack ping to person B. A trackBack ping is a small message sent from one webserver to another. Readers of your blog can use trackback in KEWL.NextGen to send your blog a ping containing a link to their blog where there may be a comment or content relevant to your blog. You can also use trackback to make links among your blogs, for example, to link an older posting to a newer one. Click the <u>Trackback</u> link to send a ping to one of your blogs. \n', 'trackback', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
