INSERT INTO `tbl_en` VALUES ('mod_library_plaigabout', 'About plagiarism\n', 'library', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_library_plagiarismdef', 'From Wikipedia, the free encyclopedia.<br><br>Plagiarism refers to the use of another''s ideas, information, language, or writing, when done without proper acknow-ledgment of the original source. It may also include an element of dishonesty relating to an attempt to pass off the plagiarised work as original.\n', 'library', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('mod_library_plagiarismdef2', 'The widespread use of the Internet has increased the incidence of plagiarism. Students are able to use search engines to locate information on a wide range of topics. Once located, this information can be cut-and-pasted into their own documents with minimal effort. This is immoral, and if you are caught in most universities you can be expelled.\n', 'library', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
