INSERT INTO `tbl_en` VALUES ('help_pbladmin_about_title', 'About Problem Based Learning Administration\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_about', 'The Problem Based Learning (PBL) administration tool provides functionality for uploading or creating pbl cases, creating a class and assigning [-readonlys-] to the class/group and managing the cases and classes.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_showcase', 'Viewing PBL Cases\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_showcase', 'A list of PBL cases can be viewed by clicking on the link ''View Cases''. A case can be deleted or uninstalled by clicking on the delete icon, this is only possible if there are no classrooms using the case. The start date and/or the case can be modified for a group of classes by selecting the group using the checkboxes on the left, select the new start date and/or the new case, click ''Go''.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_upload', 'Uploading a PBL Case\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_upload', '<p>A new case that has been created offline can be uploaded by clicking on the link ''Upload a PBL File''. The file must use the correct format for the case, two formats exist<ul><li>XML - The correct xml tags must be used, they can be found in the manual.</li><li>Text - A template is provided in the manual for the correct text format.</li></ul>Use the browse button to find the file containing the case in the correct format and click ''Upload''. The case will appear in the list of cases. Click ''Back'' to return to the list.</p>\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_createcase', 'Creating a PBL Case\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_createcase', '<p>A case can be created online by clicking on the link ''Create a Case Online''. The case is created scene by scene, fill in the form for each scene as follows<ol><li>Enter the name of the case (only displayed on the first scene).</li><li>Enter the name of the scene, this is for reference purposes and is not displayed.</li><li>Enter the information for the scene.</li><li>Optional. Enter the information for a task associated with the scene. Specialised tasks can be added by clicking on the appropriate link <ul><li>''Add an MCQ Question'' - Adds a preformated multiple choice question in the task.</li><li>''Add a Single Answer Question'' - Adds a question with a specified one word answer in the task.</li></ul></li></ol>Click ''Continue'' to add additional scenes to the case. Click ''Finish'' once the case is complete. Click ''Cancel'' to return to the ''View Cases'' Page without saving the current scene.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_addcaq', 'Adding a Single Answer Question\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_addcaq', 'A single answer question is a question with or without specified answers that will be answered by the [-readonly-] using the virtual facilitator in the chat box. A question may be added by filling the form in as follows<ol><li>Enter the question.</li><li>Enter the correct answer to the question.</li></ol>Click on ''Save'', the question will be inserted into the task in the format required by the display. Click ''Close'' to close the pop-up window.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_addmcq', 'Adding a Multiple Choice Question\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_addmcq', 'A multiple choice question is a question with a number of specified answers, one or more of which are correct. A question may be added by filling the form in as follows<ol><li>Enter the question.</li><li>Enter the answers to the question.</li><li>Select the correct answers by checking the checkbox on the left.</li><li>More answers can be added by clicking on the link ''Click here to add more options''.</li></ol>Click on ''Save'', the question will be inserted into the task in the format required by the display. Click ''Close'' to close the pop-up window.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_addclass', 'Creating a Class/Group\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_addclass', '<p>Create a new class or group by clicking on the add icon in the heading on the main page. Fill in the form as follows<ol><li>Enter a unique name to distinguish the class or group.</li><li>Select the PBL case from the list of available cases.</li><li>Select a facilitator from the list of lecturers in the course or use the virtual facilitator.</li><li>Select a group member as chair. The list for chair will be populated once students have been assigned to the class.</li><li>Select a group member as scribe. The list for scribe will be populated once students have been assigned to the class.</li><li>Set the classroom to open or closed<ul><li>Open - The classroom is accessible by all students in the course.</li><li>Closed - The classroom is only available to those students assigned to the class/group.</li></ul></li><li>Select a start date by clicking on the calendar icon and then clicking on the appropiate date. The classroom becomes available on this day.</li></ol>Click on ''Save and Edit [-readonlys-]'' to assign [-readonlys-] to the class or group if the classroom is set as ''open''. Click on ''Save'' to save and return to the main page. Click on ''Exit'' to return to the main page without saving.</p>\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_title_editstudents', 'Editing Members of a Class/Group\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_pbladmin_overview_editstudents', 'Select the [-readonlys-] to be assigned to the group from the list on the left. Click on the assign icon (>>) to move them to the list of group members on the right. Click ''Save'' to save the group. Click ''Back'' to return to the edit class page.\n', 'pbladmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
