INSERT INTO `tbl_en` VALUES ('mod_html_help_editor', '<h3>Setting Prefs for the Mozilla Rich Text Editing</h3> <p>To protect users'' private information, unprivileged scripts cannot invoke the Cut, Copy, and Paste commands in the text editor, so the  corresponding buttons on the Editing page will not work. To enable  these functions for purposes of the demo, you must modify your browser  preferences. <ol>  <li>Quit Mozilla. If you have Quick Launch running   (in Windows, an icon in the toolbar), quit that too.  <li>Find your Mozilla profile directory. On Windows, this is often   located in <code>c://WINNT/Profiles/<var>&lt;your Windows login&gt;</var>/Application Data/Mozilla</code>.<li>Open the user.js file from that directory in a text editor.   If there''s no <code class="filename">user.js</code> file, create one.  <li>   <p>Add these lines to user.js<br />   user_pref(''capability.policy.policynames'', ''allowclipboard'');<br /> user_pref(''capability.policy.allowclipboard.sites'', ''http://www.mozilla.org);<br /> user_pref(''capability.policy.allowclipboard.Clipboard.cutcopy'', ''allAccess'');<br /> user_pref(''capability.policy.allowclipboard.Clipboard.paste'', ''allAccess'');<br /></pre>  <li>Save the file, and restart Mozilla.<br /> The Clipboard buttons should now function. </ol><p><p>\n', 'htmlelements', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
