INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_about', '<p>Assignment Management provides a portal to Essay Management, Online Worksheets Administration, MCQ Tests Administration and Rubrics. New essays, worksheets and multiple choice tests can be created and existing ones modified or deleted from within Assignment Management.</p><p>A generic assignment can be created using the link <i>Add an online or uploadable assignment</i>. The assignment should be a set of directives that the students can follow. <ul><li>In the online assignment students are presented with a text box in which they can complete the assignment online and submit it.</li><li>In the uploadable assignment, students complete the assignment offline and upload a file containing the completed assignment.</li></ul></p><p>All the assignments (essays, tests, worksheets and other) can be viewed using the alphabetical links. Each assignment can be viewed, edited, deleted or marked from this point.</p>\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_about_title', 'About Assignment Management\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_overview_add', 'This is the form for creating a new assignment.<p><ol><li>Enter the name of the assignment.</li><li>Choose the assignment type <ul><li>Online means the assignment will be taken online.</li><li>Upload means the assignment will be completed offline and uploaded into the site.</li></ul></li><li>Choose whether to allow multiple submission of the assignment.</li><li>Enter the total number of marks allocated to the assignment.</li><li>Enter the percentage that the assignment counts towards the final year mark.</li><li>Select the final date for submission of the assignment by clicking on the calendar icon and selecting a date.</li><li>Enter the directives for the student to follow.</li></ol></p><p>Click save to save the assignment and exit to return to the main page without saving.</p>\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_title_add', 'Create a new Assignment\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_overview_mark', '<p>Select the mark icon for the assignment to view the list of students who''ve submitted assignments. <ol><li>Click on the mark icon for the selected student.</li><li>View the assignment.</li><li>Select a mark.</li><li>Enter a comment on the submitted assignment.</li></ol>Click save to save the mark and comment or exit to return to the main page without saving.</p>\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_assignmentadmin_title_mark', 'Marking an assignment\n', 'assignmentadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
