INSERT INTO `tbl_en` VALUES ('help_testadmin_about_title', 'About Multiple Choice Tests Administration\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_about', 'Multiple Choice Tests Administration is a managerial tool for creating tests, adding questions to the test and multiple answers to a question. The status of a test indicates whether it is still being set up or is open to [-readonlys-].\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_title_addtest', 'Creating a test\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_overview_addtest', '<p>Create a new test by clicking on the add icon. Fill in the form as follows <ol><li>Enter the name of the test.</li><li>Select the course chapter on which the test is based.</li><li>The status is set to ''Not Active'' while the test is being created, once finished it can be set to ''Open for Entry'' by editing the test. The statuses are<ul><li>''Not Active'' - the test is being set up and is not available to [-readonlys-].</li><li>''Open for Entry'' - the test is available to [-readonlys-] for completion.</li></ul></li><li>Enter the percentage the test counts towards the final year mark.</li><li>Check the box if the test should have a set time limit.</li><li>Set the duration if the test has a time limit.</li><li>Click on the calendar icon to select the closing date of the test. To select a date go to the appropriate month and click on the day. The selected date should appear in the text box.</li><li>Enter a description of the test or instructions to the [-readonlys-].</li></ol> </p><p>Click ''Save'' to save the test or ''Exit'' to return to the main page without saving.</p><p>Once the test has been created questions and answers may be added to it. Once the test is complete with questions, set it to ''open for entry'' to make it available to [-readonlys-].</p>\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_title_view', 'Viewing a test\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_overview_view', '<p>Viewing a test is where the details of the test are displayed and the questions are managed. Options for editing the test or viewing [-readonlys-] are available in the page heading. The activity status of the test is updated by editing the test.</p><p>Managing the questions in a test. <ol><li>Questions can be added by clicking on the add icon next to the questions heading. </li><li>Questions can be edited or deleted by clicking on the appropriate icon on the right. </li><li>The order in which the questions appear to the [-readonlys-] can be adjusted by clicking the up or down arrow on the right hand side.</li></ol></p>\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_title_addquestion', 'Adding a question\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_overview_addquestion', '<p>The total mark for the test is displayed under the heading. Fill in the form for the question as follows <ol><li>Enter the question.</li><li>Enter the mark for the question.</li><li>Optional. Enter a hint on how to answer the question.</li><li>Optional. Use the browse button to locate the image. Click ''Upload'' to include the image in the question.</li><li>The multiple choice answers are managed here. <ul><li>Answers can be added by clicking on the add icon next to the answers heading. </li><li>Answers can be edited or deleted by clicking on the appropriate icon on the right.</li><li>Set the correct answer by selecting the radio button for the appropriate answer. If a correct answer has not been set, the first answer is taken as correct.</li></ul></li></ol>Once the question is complete click ''Save'' to save and return to the view test page. Click ''Save and add another'' to continue adding questions. Click ''Exit'' to return to the view test page without saving.</p>\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_title_addanswers', 'Adding answers\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_overview_addanswers', '<p>Up to four answers may be added at a time. The question is displayed a the top of the page. Fill in the form for each answer as follows <ol><li>Enter the answer.</li><li>Optional. Enter a comment that will be displayed to the [-readonly-] when viewing the marked test.</li></li></ol>Once the answers are complete click ''Save'' to save and return to the view question page. Click ''Exit'' to return to the view question page without saving.</p>\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_title_liststudents', 'View students\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_testadmin_overview_liststudents', '<p>A mark icon is displayed for the test. Click on it to view a list of [-readonlys-] who have completed the test. Click on the [-readonlys-] name to view the test. The test can be reopened for a [-readonly-] by clicking on the link on the right.</p>\n', 'testadmin', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
