INSERT INTO `tbl_en` VALUES ('help_test_about_title', 'About Multiple Choice Tests\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_test_about', 'Multiple Choice Tests displays a list of mcq tests that can be opened for answering by clicking on the name of the test. Once a test has been completed it cannot be viewed until the closing date is past. The duration of a test is indicated, if the test is not completed within the specified time it will automatically submit itself. An unspecified duration indicates that the test is not timed and can be completed at leisure. Once a test is open it must be completed.\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_test_title_answertest', 'Answering a test\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_test_overview_answertest', 'The question is displayed with the multiple choice answers beneath it. To answer a question select the radio box for the correct answer. Once the page is complete click on ''Continue'' to open the next page. Once the next page has opened you cannot return to the previous page. On the last page of the test a ''Submit'' button replaces the ''Continue'' button, click on it to submit the test. The mark for the test is displayed on the main page.\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_test_title_showtest', 'Viewing a completed test\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_test_overview_showtest', 'A completed test can only be viewed after the closing date has past. Click on the name of the test to open it. Correct answers are indicated by a tick, incorrect answers by a cross. The [-authors-] comment on an answer is displayed beneath the answer.\n', 'test', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
