INSERT INTO `tbl_en` VALUES ('help_worksheet_about_title', 'About Online Worksheets\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheet_about', 'Currently a worksheet is a relatively simple assignment that is completed online and can only accept textual answers.The activity status indicates the status of the worksheet. <ul><li>''Open for entry'' indicates that it is available for answering; </li><li>''Closed for marking'' indicates that it is currently being marked; </li><li>''Marked and viewable'' indicates that it has been marked and is available for viewing. </li></ul>The closing date is the date by which the completed worksheet must be submitted before it is closed for marking. Clicking on the name of the worksheet opens it for answering if the status is open for entry and viewing if the status is marked and viewable.\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheet_title_selectforanswer', 'Answering a worksheet\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheet_overview_selectforanswer', 'To answer the worksheet, type your answer into the textbox below the question being answered. The marks indicate the amount of detail required in the answer. <p>Click ''Save & Continue'' to open the next four questions. Click ''Exit'' or ''Save'' to save the answered questions and close the worksheet for completion at a later date. The ''Submit'' button is displayed on the final page of the worksheet, click on it to submit the worksheet for marking.</p><p>Further navigation is provided at the bottom of the page. Clicking on one of the links will open the questions indicated by the link.</p>\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheet_title_viewmarked', 'Viewing a marked worksheet\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
INSERT INTO `tbl_en` VALUES ('help_worksheet_overview_viewmarked', '<p>The mark for the worksheet is shown at the top of the page, it is given out of the total marks for the worksheet and as a percentage in brackets. The mark and comment given by the [-author-] for each question is displayed below the question and answer. </p><p>Navigation is provided at the bottom of the page. Click on one of the links to open the questions indicated by the link. Click on Exit to close the worksheet.</p>\n', 'worksheet', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
