INSERT INTO `tbl_en` VALUES ('mod_nettel_agreementtext', 'User agreement.<p><p>As a student participating in the ICT/Telecommunications Policy and Regulation Diploma and Masters Degree Programmes, you must be prepared to dedicate a considerable level of effort to all course work. Specifically, for each course in which you student are enrolled you are expected to spend approximately 36 hours engaged in some form of communication with members of the course''s instructional team (Face-to-face, discussion forum or e-mail) AND approximately 84 hours engaged in some form of learning tasks (working independently or in groups). In total per course, you are expected to spend 120 hours interacting in various ways with the your course''s lecturers, expert practitioners, peers and learning materials.<p>As a student it is your responsibility to complete all assignments, including participation in the discussion forum and to meet any deadlines set for this course. A course calendar is prepared for each class and due dates for discussion forum and assignments are clearly marked. You MUST complete all coursework before sitting for final exams. It is also your responsibility to make sure that your course instructor received your assignments.<p><p>By checking the box below, you indicate that you understand your responsibility as a student and that you will meet all deadlines prior to sitting for final exams.\n', 'nettel', NULL, '2004-06-23 19:46:00', '1', NULL, NULL);
